/*********Loading Page********/
* {
    box-sizing: border-box;
    margin: 0;
    padding: 0;
}
.mplcontainer {
    position: relative;
    width: 300px;
    height: 300px;
    background-color: #487f9f;
    border-radius: 100%;
    box-shadow: inset 0px 0px 2px 1px rgba(0, 0, 0, 0.3), 0px 0px 1px 0 rgba(0, 0, 0, 0.6);
    margin: 160px auto 0;
}
.inner {
    position: absolute;
    width: 270px;
    height: 270px;
    top: 15px;
    left: 15px;
    background-color: #6fa1bd;
    border-radius: 100%;
    box-shadow: 0px 0px 2px 1px rgba(0, 0, 0, 0.3);
    transform: translate3d(0, 0, 0);
    -webkit-animation: rotate1 3s linear 0s infinite;
    -moz-animation: rotate1 3s linear 0s infinite;
    -o-animation: rotate1 3s linear 0s infinite;
    animation: rotate1 3s linear 0s infinite;
}
.inner-img {
    position: absolute;
    width: 255px;
    height: 255px;
    top: 22.5px;
    left: 22.5px;
}
.inner:before {
    content: "";
    display: inline-block;
    position: absolute;
    top: -15px;
    left: -15px;
    width: 100%;
    height: 100%;
    border: 15px solid #62eff8;
    border-left-color: transparent;
    border-bottom-color: transparent;
    border-radius: 100%;
    transform: rotate(0deg);
}
.inner:after {
    content: "";
    display: inline-block;
    position: absolute;
    top: -15px;
    left: -15px;
    width: 100%;
    height: 100%;
    border: 15px solid #62eff8;
    border-top-color: transparent;
    border-right-color: transparent;
    border-radius: 100%;
    transform: translate3d(0, 0, 0);
    -webkit-animation: rotate2 4s cubic-bezier(0.63, 0.29, 0.34, 0.74) 0s infinite alternate;
    -moz-animation: rotate2 4s cubic-bezier(0.63, 0.29, 0.34, 0.74) 0s infinite alternate;
    -o-animation: rotate2 4s cubic-bezier(0.63, 0.29, 0.34, 0.74) 0s infinite alternate;
    animation: rotate2 4s cubic-bezier(0.63, 0.29, 0.34, 0.74) 0s infinite alternate;
}
@-webkit-keyframes rotate1 {
    from {
        -webkit-transform: rotate(0deg);
    }
    to {
        -webkit-transform: rotate(360deg);
    }
}
@-webkit-keyframes rotate2 {
    from {
        -webkit-transform: rotate(10deg);
    }
    to {
        -webkit-transform: rotate(140deg);
    }
}
.img {
    background-size: cover;
    background-image: url(data:image/svg+xml;base64,);
}
.no-scroll-y {
    overflow-y: hidden;
}
.ctn-preloader {
    align-items: center;
    cursor: none;
    display: flex;
    height: 100%;
    justify-content: center;
    position: fixed;
    left: 0;
    top: 0;
    width: 100%;
    z-index: 1400;
}
.ctn-preloader .animation-preloader {
    position: absolute;
    z-index: 100;
}
.ctn-preloader .animation-preloader .spinner {
    animation: spinner 1s infinite linear;
    border-radius: 50%;
    border: 3px solid rgba(0, 0, 0, 0.2);
    border-top-color: #000000;
    height: 9em;
    margin: 0 auto 3.5em auto;
    width: 9em;
}
.ctn-preloader .animation-preloader .txt-loading {
    font: bold 5em "Montserrat", sans-serif;
    text-align: center;
    user-select: none;
}
.ctn-preloader .animation-preloader .txt-loading .letters-loading:before {
    animation: letters-loading 4s infinite;
    color: #000000;
    content: attr(data-text-preloader);
    left: 0;
    opacity: 0;
    position: absolute;
    top: 0;
    transform: rotateY(-90deg);
}
.ctn-preloader .animation-preloader .txt-loading .letters-loading {
    color: rgba(0, 0, 0, 0.2);
    position: relative;
}
.ctn-preloader .animation-preloader .txt-loading .letters-loading:nth-child(2):before {
    animation-delay: 0.2s;
}
.ctn-preloader .animation-preloader .txt-loading .letters-loading:nth-child(3):before {
    animation-delay: 0.4s;
}
.ctn-preloader .animation-preloader .txt-loading .letters-loading:nth-child(4):before {
    animation-delay: 0.6s;
}
.ctn-preloader .animation-preloader .txt-loading .letters-loading:nth-child(5):before {
    animation-delay: 0.8s;
}
.ctn-preloader .animation-preloader .txt-loading .letters-loading:nth-child(6):before {
    animation-delay: 1s;
}
.ctn-preloader .animation-preloader .txt-loading .letters-loading:nth-child(7):before {
    animation-delay: 1.2s;
}
.ctn-preloader .animation-preloader .txt-loading .letters-loading:nth-child(8):before {
    animation-delay: 1.4s;
}
.ctn-preloader .loader-section {
    background-color: #ffffff;
    height: 100%;
    position: fixed;
    top: 0;
    width: calc(51%);
}
.ctn-preloader .loader-section.section-left {
    left: 0;
}
.ctn-preloader .loader-section.section-right {
    right: 0;
}
.loaded .animation-preloader {
    opacity: 0;
    transition: 0.3s ease-out;
}
.loaded .loader-section.section-left {
    transform: translateX(-101%);
    transition: 0.7s 0.3s all cubic-bezier(0.1, 0.1, 0.1, 1);
}
.loaded .loader-section.section-right {
    transform: translateX(101%);
    transition: 0.7s 0.3s all cubic-bezier(0.1, 0.1, 0.1, 1);
}
@keyframes spinner {
    to {
        transform: rotateZ(360deg);
    }
}
@keyframes letters-loading {
    0%,
    75%,
    100% {
        opacity: 0;
        transform: rotateY(-90deg);
    }
    25%,
    50% {
        opacity: 1;
        transform: rotateY(0deg);
    }
}
@media screen and (max-width: 767px) {
    .ctn-preloader .animation-preloader .spinner {
        height: 8em;
        width: 8em;
    }
    .ctn-preloader .animation-preloader .txt-loading {
        font: bold 3.5em "Montserrat", sans-serif;
    }
}
@media screen and (max-width: 500px) {
    .ctn-preloader .animation-preloader .spinner {
        height: 7em;
        width: 7em;
    }
    .ctn-preloader .animation-preloader .txt-loading {
        font: bold 2em "Montserrat", sans-serif;
    }
}
